import React from 'react';
import bachelorArticle from '../assets/bachelor.png';
import './styles.css';

export default function Projects() {
    return (
        <div className="Body">
            <h1>Projects</h1>

            <ProjectCard imageSrc={bachelorArticle} />
        </div>
    )
}

class ProjectCard extends React.Component {
    render() {
        return(
            <div>
                <img src={this.props.imageSrc} alt="Article" />
            </div>
        )
    }
}
